import React from 'react';
import axios from "axios";


function UserDescription(props) {


  const Delete = () => {
    console.log('okk');
    axios.get(`http://localhost:5000/api/DeleteUser?id=${props.id}`)
    .then(res => {
        if(res.data.success===true){
          axios.get("http://localhost:5000/api/getAllUsers")
          .then(res => {
              if(res.data.success===true){
              this.setState({ loaded: true,data:res.data.data,length:res.data.length });
              }else {
              this.setState({ loaded: false,data:"Error in loading data" });
              }
          })
        }else {
        console.log('error in deleting user')
        }
    })
  }

  return (
    <tr>
      <td>{props.id}</td>
      <td>{props.email}</td>
      <td>{props.firstname}</td>
      <td>{props.lastname}</td>
      <td><button type="button" onClick={Delete} className="btn btn-danger">Delete</button>
      </td>

  </tr>
 
  );
}

export default UserDescription
